function module:LoadProfile()
    local profileExists = profileDb:GetProfile(key)
	if profileExists then
        self:DetailsResetProfile()
	else
		profileDb:ImportProfile(profileString, key)
		profileDb:ApplyProfile(key)
	end
    return true
end

function module:DetailsResetProfile()
    local tempCharKey = F.GetDBCharName
    profileDb:EraseProfile(key)
	profileDb:ImportProfile(profileString, key, false, false, true)
    profileDb:ApplyProfile(key)
    profileDb:EraseProfile(tempCharKey)
end

function module:Initialize()
     -- Don't init second time
    if self.Initialized then return end

    if PF:CanLoadProfileForAddon(module.Name, profileDb) then
        local loaded = self:LoadProfile()
        if loaded then
            module.ReloadUI = true
            TYMEUI:PrintMessage( module.Name..' => Profile Loaded')
            -- We are done, hooray!
			self.Initialized = true
        end
    end
end

PF:RegisterProfile(module)